def all_right_truncatable_prime(numbers):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_truncatable_prime(n):
        str_n = str(n)
        while len(str_n) > 0:
            if not is_prime(int(str_n)):
                return False
            str_n = str_n[:-1]
        return True

    x = numbers[65]
    result = []
    for i in range(x - 1, 1, -1):
        if is_truncatable_prime(i):
            result.append(i)
    return sorted(result, reverse=True)
